import {Route} from "react-router-dom"

const returnSearch = (search, string, relevantSearch) => {
  let container = [];
  let infoType = [];
  let count = [];

  search.forEach(profile => {
    profile.forEach(e => {
      if (e.data.toString().toLowerCase().includes(string)) {
        infoType.push(e.type);
        container.push(profile);
      };
    });
  });
  
  infoType.forEach(e => {
    count[e] = (count[e] || 0) + 1;
  });
  relevantSearch = Object.keys(count)[0];
  infoType = [];

  return [[...new Set(container)], relevantSearch];
}

export default returnSearch
